        id: Int
        email: String
        name: String
        nickname: String
        image: String
        token: String
        type: String
        client: String
        uid: String
        error: String
    }

    extend type Mutation {
        logInUser_1(session: SessionInput): sessionData
        registerUser(user: UserInput): sessionData
        logInUser(session: SessionInput): sessionData 
    }
`;
module.exports = typeDefs;

